import React, { useState } from 'react';


const ModalListUser = () => {
    const [showModal, setShowModal] = useState(false);

    const handleModalOpen = () => {
        setShowModal(true);
    };

    const handleModalClose = () => {
        setShowModal(false);
    };

    const handleConfirm = () => {
        // Acciones cuando se hace clic en el botón de confirmación
        setShowModal(false);
        // Realiza las acciones necesarias para confirmar
    };

    const handleCancel = () => {
        // Acciones cuando se hace clic en el botón de cancelación
        setShowModal(false);
        // Realiza las acciones necesarias para cancelar
    };

    return (
        <div>
            <div class="modal" tabindex="-1">
                <div class="modal-dialog">
                    <div class="modal-content">
                        <div class="modal-header">
                            <h5 class="modal-title">Modal title</h5>
                            <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                        </div>
                        <div class="modal-body">
                            <p>Modal body text goes here.</p>
                        </div>
                        <div class="modal-footer">
                            <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                            <button type="button" class="btn btn-primary">Save changes</button>
                        </div>
                    </div>
                </div>
            </div>

        </div>
    );
};

export default ModalListUser;
